import React from 'react'

FlightsInfo = (props) => {
  return (
    <div>
      <h1>Plane: {props.aircraft}</h1>
      <h1>Carrier: {props.carriers}</h1>
      <h1>Departure Time: {props.depTime}</h1>
      <h1>Arrival Time: {props.arrTime} </h1>
    </div>
  )
}

export default FlightsInfo
